CREATE DATABASE property_database CHARACTER SET utf8 COLLATE utf8_general_ci;
use property_database;


CREATE TABLE users
(
    id                     INT NOT NULL AUTO_INCREMENT,
    username               VARCHAR(50),
    first_name             TEXT,
    last_name              TEXT,
    birth_date             DATE,
    created_at             TIMESTAMP,
    updated_at             TIMESTAMP,
    pwd                    TEXT,
    last_logged_in         TIMESTAMP,
    invalid_login_attempts INT,
    pwd_changed            TIMESTAMP,
    PRIMARY KEY (id),
    INDEX (username),
    INDEX (created_at)
);
CREATE TABLE cars
(
    id                INT NOT NULL AUTO_INCREMENT,
    user_id           INT,
    maker             TEXT,
    model             TEXT,
    year              INT,
    trim              TEXT,
    vin               VARCHAR(17),
    estimated_cost    INT,
    registration_date TIMESTAMP,
    PRIMARY KEY (id),
    FOREIGN KEY (user_id)
        REFERENCES users (id)
        ON DELETE CASCADE
);
CREATE TABLE flats
(
    id                INT NOT NULL AUTO_INCREMENT,
    user_id           INT,
    country           TEXT,
    city              TEXT,
    address           TEXT,
    estimated_cost    INT,
    registration_date TIMESTAMP,
    PRIMARY KEY (id),
    FOREIGN KEY (user_id)
        REFERENCES users (id)
        ON DELETE CASCADE
);



